package String;

public class LastIndexOf {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s="asbcjbfhabcbjbfkdsjb";
		
		
		//if two same string are present in the given string then it will give index of first string 
		//give index of first element of string
		
		
		
		
		int lastIndexOf=s.lastIndexOf("jbf");
		System.out.println(lastIndexOf);

	}

}
